import React from 'react';
import Sdata from './Sdata';
import Card from './Cards';

const Amazon =() => {
(
    <Card
        key={Sdata[4].id}
        imgscr={Sdata[4].imgscr}
        title={Sdata[4].title}
        sname={Sdata[4].sname}
        link={Sdata[4].links}
    />
)}


export default Amazon;
